import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => (
  <nav className="bg-blue-600 text-white p-4 shadow flex justify-center">
    <div className="flex gap-6">
      <Link className="hover:bg-blue-800 px-4 py-2 rounded transition" to="/">首页</Link>
      <Link className="hover:bg-blue-800 px-4 py-2 rounded transition" to="/login">登录</Link>
      <Link className="hover:bg-blue-800 px-4 py-2 rounded transition" to="/signup">注册</Link>
      <Link className="hover:bg-blue-800 px-4 py-2 rounded transition" to="/lecturer">教师界面</Link>
    </div>
  </nav>
);
export default Navbar;
